import re

INPUT = """




"""

inp = INPUT.replace("\n", "")
s = set(inp.lower())
pats = []
for letter in s:
    pats.append((comb := letter + letter.upper()))
    pats.append(comb[::-1])
pats = "|".join(pats)
pat = re.compile(pats)

done = False
while not done:
    a = re.sub(pat, "", inp)
    if (l := len(a)) == len(inp):
        print(l)
        done = True
    else:
        inp = a

# part 2
def react_polymer(polymer: str) -> int:
    """Reacts a polymer

    Args:
        polymer (str): the chain of charcaters making up the polymer

    Returns:
        int: the lenght of the fully reacted polymer
    """
    while True:
        a = re.sub(pat, "", polymer)
        if (l := len(a)) == len(polymer):
            return l
        polymer = a


inp = INPUT.replace("\n", "")
print(
    min(
        react_polymer(polymer)
        for polymer in [
            inp.replace(letter, "").replace(letter.upper(), "") for letter in s
        ]
    )
)
